import React from 'react';
import { Link } from 'react-router-dom';
import { Menu } from 'antd';
import images from './img.js';

const Header = () => {
  return (
    <header className="header">
      <div className="logo">
        <Link to="/">
          <img src={images.logo} width="300px" height="40px" alt="logo" />
        </Link>
      </div>
      <Menu mode="horizontal">
        <Menu.Item key="1" disabled>Казань</Menu.Item>
        <Menu.Item key="2">
          <Link to="/Login">
            <img src={images.icon} width="30px" height="25px" alt="icon" />
          </Link>
        </Menu.Item>
      </Menu>
    </header>
  );
}

export default Header;
